import React from 'react'

const Home = () => {
  return (
    <div className='w-full'>
        <div className='border-2 border-slate-800 bg-slate-800 text-white p-5 font-semibold text-xl'>
            Welcome To Gym Managerment(GMS)
        </div>
        <div className='w-full bg-cover bg-[url("https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.rawpixel.com%2Fsearch%2Fgym%2520background&psig=AOvVaw2vFjozngYX5KZgsUqJBQ6y&ust=1743307986376000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCKCwxra2rowDFQAAAAAdAAAAABAJ")]'></div>
    </div>
  )
}

export default Home
